class my extends Component {
    constructor() {
        super();
        this.state = {}
    }
    add=()=>{
        this.props.history.push('/Circle')
    }
    render() {
        return (<div className={"HEAD"}><img alt={"标本"} src={"https://image.hongbeibang.com/FrYeKj0MohOJQuNzUgCugg90cHCS?50X50&imageView2/1/w/50/h/50"}/>
        <p>我</p></div>)
    }

}

export default my;
